import React, {useState} from 'react'

const styles = {
    form: {
        marginBottom: '20px',
    },

    input: {
        width: '400px',
        height: '50px',
        borderRadius: '10px',
        border: '1px solid gray',
        fontSize: '16px',
        outline: 'none',
        padding: '3px 15px',
        boxSizing: 'border-box'
    },

    button: {
        height: '50px',
        padding: '8px 20px',
        marginLeft: '20px',
        borderRadius: '10px',
        border: '1px solid gray',
        fontSize: '16px',
        cursor: 'pointer',
        outline: 'none',
        boxSizing: 'border-box'
    }
}

function AddTodo() {
    const [value, setValue] = useState('')
    return(
        <form style={styles.form}>
            <input type="text" style={styles.input} value={value} />
            <button type="submit" style={styles.button}>Add new task!</button>
        </form>
    )
}

export default AddTodo
